CREATE TABLE `ARTICULO` (  
`ID_ARTICULO` int (11) AUTO_INCREMENT not null,  
`TITULO` varchar (100) not NULL,  
`CONTENIDO` varchar (1000) not NULL,  
`FECHA_CREACION` timestamp  not null, 
`IMAGEN` varchar (1000) not NULL,  
`ID_AUTOR` varchar (1000) not NULL,  
PRIMARY KEY (`ID_ARTICULO`)
);

CREATE TABLE `AUTOR` (  
`ID_AUTOR` int (11) AUTO_INCREMENT not null,  
`NOMBRE` varchar (100) not NULL,  
`APELLIDO` varchar (100) not NULL,  
`EMAIL` varchar (200) not NULL,  
PRIMARY KEY (`ID_AUTOR`)
);

CREATE TABLE `COMENTARIO` (  
`ID_COMENTARIO` int (11) AUTO_INCREMENT not null,  
`COMENTARIO` varchar (500) not NULL,  
`ID_ARTICULO` varchar (100) not NULL, 
`AUTOR_COMENTARIO` varchar (100) not NULL,
`FECHA_COMENTARIO` timestamp not NULL,
PRIMARY KEY (`ID_COMENTARIO`)
);





